import React, { useState } from "react";

import "../assets/sty_slide.css";

function Slider() {
  return (
    <div className="slider-container">
      <div className="slide">
        <img className="slideImg" alt="" src="./image/img/slider2.jpg" />

        <img className="slideImg" alt="" src="./image/img/slider1.jpg" />

        <img className="slideImg" alt="" src="./image/img/slider3.jpg" />
      </div>
    </div>
  );
}

export default Slider;
